import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import UserList from './component/UserList';
import {Provider} from 'react-redux';
import store from './store';
function App() {
  return (
    <Provider store={store}>
    <div className="App">
      <UserList/>
    </div>
    </Provider>
  );
}

export default App;
